public ContainerId getContainerId() {
  TaskAttemptReportProtoOrBuilder p = viaProto ? proto : builder;
  if (containerId != null) {
    return containerId;
  } // Else via proto
  if (!p.hasContainerId()) {
    return null;
  }
  containerId = convertFromProtoFormat(p.getContainerId());
  return containerId;
}
